import React from 'react';
import { Button, ThemeProvider, createMuiTheme, red } from '@material-ui/core/Button';

function App() {
  const theme = createMuiTheme({
    palette:{ 
      primary: {
        main: red
      }
    }

  });
  return (
    <ThemeProvider theme={theme}>
      <Button variant='contained' color="primary">Daniel</Button>;
    </ThemeProvider>
  )
}

export default App;
